import {Container, Row,Button} from 'reactstrap'
import {NavLink, Link} from 'react-router-dom'

const Nav_link=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'#',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },
]

const Header = () => {
  return (
    <header className="header">
      <Container>
        <Row>
          <div className="nav__wrapper d-f">

          </div>
        </Row>
      </Container>
    </header>
  )
}

export default Header
